import React from "react";
import { View, Button, Text, StyleSheet } from "react-native";
import { Avatar,Card, Title, Paragraph  } from 'react-native-paper';

const Tools = () => {
  return (
    <View style={styles.center}>

    <Card style = {{backgroundColor: "#f5f5f5"}}>
    <Card.Title
    title="Scientific Calculator"
    subtitle="Card Subtitle"
    left={(props) => <Avatar.Icon {...props} icon="folder" />}
  />
    </Card>
    {/* <Card style = {{backgroundColor: "#f5f5f5"}}>
    <Card.Content>
    <Avatar.Icon size={44} icon="calculator"  style = {styles.avt}/>
    <Title>Scientific Calculator</Title>
    </Card.Content>
    </Card> */}
    
    <Card style = {{backgroundColor: "#f5f5f5"}}>
    <Card.Content>
    <Avatar.Icon size={44} icon="rotate-3d-variant"  style = {styles.avt}/>
    <Title>Unit Convertion</Title>
    </Card.Content>
    </Card>

    <Card style = {{backgroundColor: "#f5f5f5"}}>
    <Card.Content>
    <Avatar.Icon size={44} icon="bluetooth-connect"  style = {styles.avt}/>
    <Title>Bluetooth RC Control</Title>
    </Card.Content>
    </Card>

    <Card style = {{backgroundColor: "#f5f5f5"}}>
    <Card.Content>
    <Avatar.Icon size={44} icon="scale-balance"  style = {styles.avt}/>
    <Title>Currency Converter</Title>
    </Card.Content>
    </Card>
    </View>
  );
};

const styles = StyleSheet.create({
  center: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
    textAlign: "center",
  },
  avt: {
    textAlign: "center"
  }
});

export default Tools;
